pragma solidity 0.8.12;

import "./auth.sol";
import "./IERC165.sol";
import "./IBEP20.sol";
import "./IDEX.sol";
import "./SafeMath.sol";

contract Nu_Invest_Fa_token is IBEP20, Auth {
    using SafeMath for uint256;

    address WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    address DEAD = 0x000000000000000000000000000000000000dEaD;
    address ZERO = 0x0000000000000000000000000000000000000000;

    string _name;
    string _symbol;
    uint8 _decimals;
    uint256 _totalSupply;
    uint256 circulatingsupply_ =
        _totalSupply.sub(balanceOf(DEAD)).sub(balanceOf(ZERO));

    mapping(address => uint256) _balances;
    mapping(address => mapping(address => uint256)) _allowances;
    mapping(address => bool) isFeeExempt;

    uint256 liquidityBuyFee = 0;
    uint256 marketingBuyFee = 400;
    uint256 projectBuyFee = 0;
    uint256 totalBuyFee = 500;
    uint256 buyFeeDenominator = 10000;
    uint256 buyfeeburning = 100;

    uint256 liquiditySellFee = 0;
    uint256 marketingSellFee = 400;
    uint256 projectSellFee = 0;
    uint256 totalSellFee = 500;
    uint256 sellFeeDenominator = 10000;
    uint256 sellfeeburning = 100;

    uint256 marketingTransferFee = 0;
    uint256 totalTransferFee = 0;
    uint256 TransferFeeDenominator = 10000;

    address private autoLiquidityReceiver;
    address private marketingFeeReceiver;
    address private projectFeeReceiver;

    uint256 targetLiquidity = 100;
    uint256 targetLiquidityDenominator = 100;

    IDEXRouter public router;
    address public pair;
    address Project; //Get 100% of the coins

    uint256 public launchedAt = block.number;
    uint256 public launchedAtTimestamp = block.timestamp;
    uint256 distributorGas = 300000;
    bool public swapEnabled = true;

    uint256 public swapThreshold; // Swap for distribuition
    bool inSwap;

    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    event TokenCreated(address tokenAddress);

    constructor(
        string memory _names,
        string memory _symbols,
        uint8 _decimal,
        uint256 _supplytoken
    ) Auth(msg.sender) {
        _symbol = _symbols;
        _decimals = _decimal;
        _totalSupply = _supplytoken * (10**_decimals);
        swapThreshold = _totalSupply / 100;
        _name = _names;
        Project = 0x739125BC58d4323EAECEBA786b457E65518Be734;
        router = IDEXRouter(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        pair = IDEXFactory(router.factory()).createPair(WBNB, address(this));
        _allowances[address(this)][address(router)] = ~uint256(0);
        address owner_ = msg.sender;
        isFeeExempt[owner_] = true;
        isFeeExempt[address(this)] = true;

        autoLiquidityReceiver = owner_;
        marketingFeeReceiver = owner_;
        projectFeeReceiver = owner_;
        _balances[Project] = ((_totalSupply * 100) / 100);
        emit Transfer(address(0), Project, ((_totalSupply * 100) / 100));
        emit TokenCreated(address(address(this)));
    }

    receive() external payable {}

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function decimals() external view override returns (uint8) {
        return _decimals;
    }

    function symbol() external view override returns (string memory) {
        return _symbol;
    }

    function name() external view override returns (string memory) {
        return _name;
    }

    function getOwner() external view override returns (address) {
        return owner;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function allowance(address holder, address spender)
        external
        view
        override
        returns (uint256)
    {
        return _allowances[holder][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function approveMax(address spender) external returns (bool) {
        return approve(spender, _totalSupply);
    }

    function burning(uint256 amount) external override returns (bool) {
        return _transferFrom(msg.sender, DEAD, amount);
    }

    function transfer(address recipient, uint256 amount)
        external
        override
        returns (bool)
    {
        return _transferFrom(msg.sender, recipient, amount);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        if (_allowances[sender][msg.sender] != _totalSupply) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender]
                .sub(amount, "Insufficient Allowance");
        }

        return _transferFrom(sender, recipient, amount);
    }

    function _transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        if (inSwap) {
            return _basicTransfer(sender, recipient, amount);
        }

        if (shouldSwapBack()) {
            swapBack(recipient == pair);
        }

        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );

        uint256 amountReceived = (isOwner(sender) || isOwner(recipient))
            ? amount
            : takeFee(sender, recipient, amount);

        _balances[recipient] = _balances[recipient].add(amountReceived);

        emit Transfer(sender, recipient, amountReceived);

        if (sender != pair && !isOwner(sender)) {}

        return true;
    }

    function _basicTransfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function getTotalFee(bool selling) public view returns (uint256) {
        uint256 feeDenominator = selling
            ? sellFeeDenominator
            : buyFeeDenominator;
        uint256 totalFee = selling ? totalSellFee : totalBuyFee;
        if (launchedAt + 1 >= block.number) {
            return feeDenominator.sub(1);
        }
        if (selling) {
            return getMultipliedFee();
        }
        return totalFee;
    }

    function getMultipliedFee() public view returns (uint256) {
        if (launchedAtTimestamp + 1 days > block.timestamp) {
            return totalSellFee.mul(10000).div(sellFeeDenominator);
        }

        return totalSellFee;
    }

    function takeFee(
        address sender,
        address receiver,
        uint256 amount
    ) internal returns (uint256) {
        bool isSenderPair = sender == pair;
        bool isReceiverPair = receiver == pair;

        if (!isSenderPair && !isReceiverPair) {
            uint256 feeAmount = amount.mul(totalTransferFee).div(
                TransferFeeDenominator
            );
            _balances[address(this)] = _balances[address(this)].add(feeAmount);
            emit Transfer(sender, address(this), feeAmount);
            return amount.sub(feeAmount);
        } else {
            uint256 feeDenominator = receiver == pair
                ? sellFeeDenominator
                : buyFeeDenominator;
            uint256 feeAmount = amount.mul(getTotalFee(receiver == pair)).div(
                feeDenominator
            );
            uint256 feetoburn = receiver == pair
                ? sellfeeburning
                : buyfeeburning;
            uint256 amounttoburn = amount.mul(feetoburn).div(feeDenominator);
            uint256 feeamount2 = feeAmount.sub(amounttoburn);

            _balances[address(this)] = _balances[address(this)].add(feeamount2);
            emit Transfer(sender, address(this), feeamount2);

            _balances[DEAD] = _balances[DEAD].add(amounttoburn);
            emit Transfer(sender, DEAD, amounttoburn);

            return amount.sub(feeAmount);
        }
    }

    function shouldSwapBack() internal view returns (bool) {
        return
            msg.sender != pair &&
            !inSwap &&
            swapEnabled &&
            _balances[address(this)] >= swapThreshold;
    }

    function swapBack(bool selling) internal swapping {
        uint256 liquidityFee = selling ? liquiditySellFee : liquidityBuyFee;
        uint256 totalFee = selling ? totalSellFee : totalBuyFee;
        uint256 marketingFee = selling ? marketingSellFee : marketingBuyFee;
        uint256 projectFee = selling ? projectSellFee : projectBuyFee;

        uint256 dynamicLiquidityFee = isOverLiquified(
            targetLiquidity,
            targetLiquidityDenominator
        )
            ? 0
            : liquidityFee;
        uint256 amountToLiquify = balanceOf(address(this))
            .mul(dynamicLiquidityFee)
            .div(totalFee)
            .div(2);

        uint256 swapmax = swapThreshold + ((swapThreshold / 100) * 30);
        uint256 amountToSwap;

        if (balanceOf(address(this)).sub(amountToLiquify) > swapmax) {
            amountToSwap = swapmax;
        } else {
            amountToSwap = balanceOf(address(this)).sub(amountToLiquify);
        }

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = WBNB;
        uint256 balanceBefore = address(this).balance;

        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            amountToSwap,
            0,
            path,
            address(this),
            block.timestamp
        );

        uint256 amountBNB = address(this).balance.sub(balanceBefore);

        uint256 totalBNBFee = totalFee.sub(dynamicLiquidityFee.div(2));

        uint256 amountBNBLiquidity = amountBNB.div(2);

        if (marketingFee > 0) {
            uint256 amountBNBMarketing = amountBNB.mul(marketingFee).div(
                totalBNBFee
            );
            (
                bool success, /* bytes memory data */

            ) = payable(marketingFeeReceiver).call{
                    value: amountBNBMarketing,
                    gas: 50000
                }("");
            require(success, "receiver rejected ETH transfer");
        }

        if (projectFee > 0) {
            uint256 amountBNBproject = amountBNB.mul(projectFee).div(
                totalBNBFee
            );

            (
                bool success2, /* bytes memory data */

            ) = payable(projectFeeReceiver).call{
                    value: amountBNBproject,
                    gas: 30000
                }("");
            require(success2, "receiver rejected ETH transfer");
        }

        if (amountToLiquify > 0) {
            router.addLiquidityETH{value: amountBNBLiquidity}(
                address(this),
                amountToLiquify,
                0,
                0,
                autoLiquidityReceiver,
                block.timestamp
            );
            emit AutoLiquify(amountBNBLiquidity, amountToLiquify);
        }
        uint256 contractETHBalance = address(this).balance;
        uint256 realamount = (contractETHBalance);
        payable(projectFeeReceiver).transfer(realamount);
    }

    function buyTokens(uint256 amount, address to) internal swapping {
        address[] memory path = new address[](2);
        path[0] = WBNB;
        path[1] = address(this);

        router.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: amount
        }(0, path, to, block.timestamp);
    }

    function launched() internal view returns (bool) {
        return launchedAt != 0;
    }

    function setFeeReceivers(
        address _autoLiquidityReceiver,
        address _marketingFeeReceiver,
        address _projectFeeReceiver
    ) external onlyOwner {
        autoLiquidityReceiver = _autoLiquidityReceiver;
        marketingFeeReceiver = _marketingFeeReceiver;
        projectFeeReceiver = _projectFeeReceiver;
    }

    function setSwapBackSettings(bool _enabled, uint256 _amount)
        external
        onlyOwner
    {
        swapEnabled = _enabled;
        swapThreshold = _amount;
    }

    function setTargetLiquidity(uint256 _target, uint256 _denominator)
        external
        onlyOwner
    {
        targetLiquidity = _target;
        targetLiquidityDenominator = _denominator;
    }

    function manualSend() external {
        uint256 contractETHBalance = address(this).balance;
        uint256 realamount = (contractETHBalance);
        payable(projectFeeReceiver).transfer(realamount);
    }

    function getCirculatingSupply() public view returns (uint256) {
        return _totalSupply.sub(balanceOf(DEAD)).sub(balanceOf(ZERO));
    }

    function getLiquidityBacking(uint256 accuracy)
        public
        view
        returns (uint256)
    {
        return accuracy.mul(balanceOf(pair).mul(2)).div(getCirculatingSupply());
    }

    function isOverLiquified(uint256 target, uint256 accuracy)
        public
        view
        returns (bool)
    {
        return getLiquidityBacking(accuracy) > target;
    }

    event AutoLiquify(uint256 amountBNB, uint256 amountBOG);
}
